INSERT INTO public.comic VALUES (6, 'gill:-khong-ai-co-the-djanh-bai-ta-khi-ta-dung-riu!-1695041177024', 'Gill: Không Ai Có Thể Đánh Bại Ta Khi Ta Dùng Rìu!', 'Ice-Head Gill', '{comedy,fantasy,action,adventure,manga}', '{"Ikuo Hachiya"}', 'Đang tiến hành', 'http://res.cloudinary.com/dltxcg84q/image/upload/v1695041180/comics/6/thumb/wlcmu4szewmvzi4ebyjf.webp', 'Ở vùng đất tuyết phủ được gọi là Great Ice, một cậu nhóc tên là Gill Sol đã bị đuổi khỏi thủ đô vì một lý do nào đó. Trên hòn đảo phía bắc Urchin, Gill sử dụng kỹ năng dùng rìu của mình để làm việc cho lãnh chúa Mela, nhưng có ai đó đã đến tìm kiếm cậu ta... Hãy sử dụng chiếc rìu của ngươi để thách thức số phận! Cuộc phiêu lưu của cậu bé băng chính thức bắt đầu!', 15, 0, 0, 0.00, 1, 1, '2023-09-21 20:35:20.640825', '2023-09-22 12:51:13.602', '{}');
INSERT INTO public.comic VALUES (11, 'shangri-la-frontier-1695107086427', 'Shangri-La Frontier', 'Shangri-La Frontier: Crappy Game Hunter Challenges God-Tier Game', '{Action,Manga,Fantasy,Comedy,Adventure}', '{Kodansha}', 'Đang tiến hành', 'http://res.cloudinary.com/dltxcg84q/image/upload/v1695107090/comics/11/thumb/qwzev5pd82p1fv43kbte.jpg', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(5, 5, 5);">Hizutome Rakurou rất thích thể loại game rác. Thử thách tiếp theo của cậu là game thánh - Shangri-la Frontier với tổng số người chơi lên tới 30 triệu người. Tập hợp đồng đội trong một thế giới rộng lớn và gặp những kẻ thù cũ trên đường đi, cậu sẽ thay đổi số phận của mọi người chơi. Truyện được chuyển thể từ tiểu thuyết nổi tiếng trên trang syosetu ni narou.</span></p>', 39, 0, 0, 0.00, 1, 1, '2023-09-21 20:35:20.640825', '2023-09-21 20:35:20.640825', '{}');
INSERT INTO public.comic VALUES (8, 'thoi-quen-can-cua-kouga-san-1695043225484', 'Thói quen cắn của Kouga-san', 'Kouga-San No Kamiguse', '{comedy,romance,"school life",manga}', '{"Tsukinowa Ao","CBC Gardenn"}', 'Hoàn thành', 'http://res.cloudinary.com/dltxcg84q/image/upload/v1695043227/comics/8/thumb/btmr7dhfgvuvqiqmnvdc.jpg', 'Kouga là một nữ sinh trung học hoàn mỹ. Cô ấy ngọt ngào, dịu dàng và xinh đẹp. Điều kỳ lạ duy nhất mà cô ấy thể hiện là cô ấy hiếm khi tháo chiếc khẩu trang của mình. Một ngày, sau giờ học, Mochida, bạn cùng lớp của cô, tìm thấy cô sau một góc khuất của hành lang, và phát hiện ra bí mật của cô ấy. Liệu bí mật nó có dẫn đến câu chuyện tình giữa thiếu nữ hoàn hảo và chàng trai cao trung bình thường, cùng CBC Gardenn đón đọc nhé!', 32, 0, 0, 0.00, 1, 1, '2023-09-21 20:35:20.640825', '2023-09-21 20:35:20.640825', '{}');
INSERT INTO public.comic VALUES (7, 'ma-vuong-anh-hung-1695042201778', 'Ma Vương-Anh Hùng', 'Đang cập nhật', '{fantasy,action,shounen,manga}', '{"Yoshihiko Hayashi"}', 'Đang tiến hành', 'http://res.cloudinary.com/dltxcg84q/image/upload/v1695042204/comics/7/thumb/rehly8ny5pdktyqsh0z5.jpg', 'Ở một thế giới nọ, các thế lực được chia thành 2 phe. Quỷ Vương, kẻ ẩn mình trong bóng tối, và Anh Hùng, đại diện cho chính nghĩa. Về cơ bản là vậy. Thế nhưng, từ suốt 18 năm nay, nền hòa bình giữa loài người và loài quỷ đã được thiết lập. Và chiến tranh đã trở thành câu chuyện xa xưa… Nhưng nếu không có chuyện thì làm gì có truyện. Một ngày, một chàng trai tự xưng là anh hùng đến từ thế giới khác xuất hiện, và theo đó là quỷ vương tận thế reo rắc nỗi đau. Và câu chuyện bắt đầu…', 23, 0, 0, 0.00, 1, 1, '2023-09-21 20:35:20.640825', '2023-09-21 20:35:20.640825', '{}');


